import React from 'react'

export default function Profile(props) {
    return (
       <div className="Pro">
        {props.children }


       {props.ProfileCard.map(ProfileCard=>

        <div className={ProfileCard}>
        <h1>{ProfileCard.fullName}</h1>
        <p>{ProfileCard.bio}</p>
        <h3>{ProfileCard.profession}</h3>

        </div>
        )}
       </div>

    )
}
